import { setViewingNote, viewingNote } from '../states/viewingNote'
import { playEnterSound } from '../states/soundLibrary'

export const DeleteButton = () => {
  return (
    <button
      onClick={() => {
        playEnterSound()
        fetch(`api/note`, {
          method: 'DELETE',
          body: JSON.stringify(viewingNote._id),
        })
        setViewingNote(null)
      }}
    >
      Delete
    </button>
  )
}
